  { name: 'show-nominees', 
    label: 'Show Nominees', 
    items: [
      { id: 'tt123', title: 'HelloWorld', yor: '2000', nominated: 'yes'}
    ] },
];

function App() {
  return (
    <div className="App">
      <Sidebar items={ items }/>
      <Search/>
    </div>
  );
}

export default App;
